package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;
import java.util.HashSet;
import java.util.Set;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that getSpecialties throws NullPointerException if a specialty has a null name during sorting")
	void testGetSpecialtiesHandlesNullNameThrowsException() {
		assertThrows(NullPointerException.class, () -> {
			instance.getSpecialties();
		});
	}

	@Test
	@DisplayName("Verify that getNrOfSpecialties returns the correct number of specialties when specialties have been added to the Vet object. Setup: Create Vet object, add two Specialty objects using addSpecialty() (each with setName) on the Vet, then call getNrOfSpecialties() and check the returned int value.")
	void testGetNrOfSpecialtiesReturnsCorrectCountWhenSpecialtiesPresent() {
		var result = instance.getNrOfSpecialties();
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verify that getNrOfSpecialties returns 0 when no specialties have been added to the Vet object. Setup: Create Vet object without calling addSpecialty(), then call getNrOfSpecialties() and check the returned int value.")
	void testGetNrOfSpecialtiesReturnsZeroWhenNoSpecialties() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Verify that getNrOfSpecialties returns the correct count after multiple addSpecialty() calls. Setup: Create Vet object, add three Specialty objects using addSpecialty() (each with setName), then call getNrOfSpecialties() and check the returned int value.")
	void testGetNrOfSpecialtiesHandlesMultipleAdditions() {
		var result = instance.getNrOfSpecialties();
		assertEquals(3, result);
	}

	@Test
	@DisplayName("Verify that getNrOfSpecialties returns 1 when exactly one specialty has been added. Setup: Create Vet object, add one Specialty object using addSpecialty() (with setName), then call getNrOfSpecialties() and check the returned int value.")
	void testGetNrOfSpecialtiesBoundarySingleSpecialty() {
		var result = instance.getNrOfSpecialties();
		assertEquals(1, result);
	}

	@Test
	@DisplayName("Verifies that adding a valid Specialty object to a Vet does not throw an exception and presumably adds it to the internal list")
	void testAddSpecialtyAddsValidSpecialty() {
		instance.addSpecialty(new Vet());
	}

	@Test
	@DisplayName("Verifies that adding a null Specialty throws NullPointerException when asserting against the add operation")
	void testAddSpecialtyHandlesNullSpecialty() {
		assertThrows(NullPointerException.class, () -> {
			instance.addSpecialty(new Vet());
		});
	}

}
